if mibBuilder.loadTexts: s5AgInfoReBoot.setDescription('Action object to reboot the agent. The following values can only be read: other(1).....agent in unknown or other state running(2)...agent running The following values can be written: restart(3)...restart agent (i.e., jump to beginning of agent code) reboot(4)....start boot sequence for agent (i.e., jump to beginning of boot firmware) reset(5).....do a hardware reset download(6)..............activate download of a new agent downloadAndRestart(7)....activate download of a new agent and restart downloadAndReboot(8).....activate download of a new agent and reboot downloadAndReset(9)......activate download of a new agent and reset If s5AgInfoScheduleBootTime is set in the same PDU as s5AgInfoReBoot, the action specified occurs when the scheduled time reaches zero; otherwise, the action occurs immediately. The agent does best efforts to return a response before the action occurs. If any of the combined download actions are requested, neither action occurs until the expiry of s5AgInfoScheduleBootTime, if set.')
s5AgInfoWriteCfg = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("other", 1), ("valid", 2), ("write", 3)))).setMaxAccess("readwrite")
