s5AgInfoMgmtProtocolCur = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("other", 1), ("ipOnly", 2), ("ipxOnly", 3), ("ipAndIpx", 4)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5AgInfoMgmtProtocolCur.setStatus('current')
if mibBuilder.loadTexts: s5AgInfoMgmtProtocolCur.setDescription('The current transport protocol(s) that are being supported by the agent. The following value is read-only: other(1)....unknown or some other protocol The following value is read-write: ipOnly(2).....only IP ipxOnly(3)....only IPX ipAndIpx(4)...IP and IPX. When the IP protocol stack is not enabled, the agent will not respond to PING or SNMP requests over IP. When the IPX protocol stack is not enabled, the agent will not respond to diagnostic SAP or SNMP requests over IPX. It is suggested that NMS not disable the transport they are using.')
s5AgInfoBootMode = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6, 7, 8))).clone(namedValues=NamedValues(("other", 1), ("local", 2), ("net", 3), ("netWhenNeeded", 4), ("netOrLastAddress", 5), ("dhcp", 6), ("dhcpWhenNeeded", 7), ("dhcpOrLastAddress", 8)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5AgInfoBootMode.setStatus('current')
if mibBuilder.loadTexts: s5AgInfoBootMode.setDescription("The source for initial protocol configuration information at next boot. For IP, a setting of net(3), netWhenNeeded(4), or netOrLastAddress(5) means that BOOTP will be used to get the agent's IP address(es), load server address, and configuration file name. For IPX, a setting of net(3), netWhenNeeded(4), or netOrLastAddress(5) means SAP will be used to get the agent's Novell network number(s), and the configuation filename will be loaded from local storage (note - the load server address is not needed in a Novell network). The following value is read-only: other(1).....not applicable or some other case The following values are read-write: local(2) Don't use the network. net(3) Try using the network and if that fails then use protocol configuration information from local storage. netWhenNeeded(4) Use protocol configuration information from local storage if available, otherwise, try using the network. netOrLastAddress(5) Similar to netWhenNeeded, except that if using the network fails, the last set of protocol configuration information that was obtained using the network will be used if it is available. Note: The load server address is not configurable and is not available in this MIB object on a Novell network.")
s5AgInfoCfgLoadMode = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("other", 1), ("local", 2), ("net", 3), ("locAsBk", 4)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5AgInfoCfgLoadMode.setStatus('current')
if mibBuilder.loadTexts: s5AgInfoCfgLoadMode.setDescription('The source from which to load configuration information at next boot. The following value is read-only: other(1)...not applicable or some other case The following values are read-write: local(2).....get from local storage net(3).......load from the network locAsBk(4)...try using network and if it fails then use local information. When local(2) is specified, the configuration information is loaded from local storage. If the local configuration is not valid (checks for ip = 0.0.0.0), then BOOTP is used for the IP stack. (In IPX only mode, the IP address could be 0.0.0.0 and IPX does not rely on the IP address. The agent checks the IPX address, and if the network number of the IPX address is equal to 0 the agent uses SAP). When net(3) is specified, the configuration information will be downloaded from the network only. The configuration information will never be loaded from local storage, even if downloading fails and the local configuration information exists. When locAsBk(4) is specified, a download of the configuration information will be tried over the network. If the network download fails then the configuration information will be loaded from local storage.')
s5AgInfoImgLoadMode = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("other", 1), ("local", 2), ("net", 3), ("locAsBk", 4), ("netIfNewer", 5)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5AgInfoImgLoadMode.setStatus('current')
if mibBuilder.loadTexts: s5AgInfoImgLoadMode.setDescription("The source from which to load the agent image at next boot. The following value is read-only: other(1)...not applicable or some other case The following values are read-write: local(2)........get from local storage net(3)..........load from the network locAsBk(4)......try using network and if it fails then use local information. netIfNewer(5)...try loading image over the net. If can load image, and it is newer than the local image, then use it. Otherwise, use local image. If the local image is not valid, the setting will be net(3) and cannot be changed to local(2), or locAsBk(4) until a valid image file is loaded (i.e., error 'badValue' will be returned on SETS with value other than net(3)). When the local image is not valid and the network download of the image fails, the entire boot process will be repeated. When local(2) is specified, the image will be loaded from local storage. When net(3) is specified, the image will be downloaded from the network only. The image file will never be loaded from local storage, even if downloading fails and the local image exists. When locAsBk(4) is specified, a download of the image will be tried over the network. If the network download fails then the image is loaded from local storage. When netIfNewer(5) is specified, a download of the image will be tried over the network. If successful, it will then be compared to the image stored in local storage. The most recent version of the two will be used. If the local image is not valid, the network will always be used. If the network download fails then the image is loaded from the local storage.")
s5AgInfoImgSaveMode = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 8), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("notAvail", 1), ("writeIfDiff", 2), ("writeIfNewer", 3), ("noWrite", 4)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: s5AgInfoImgSaveMode.setStatus('current')
if mibBuilder.loadTexts: s5AgInfoImgSaveMode.setDescription('Indicates what to do with the image (when loaded from the network) on the next boot. The following value can only be read: notAvail(1)...the save operation is not available The following values can be written (and read) if the device supports this capability: writeIfDiff(2)....save image to local storage at next boot if image is different from saved contents writeIfNewer(3)...save image to local storage at next boot if image is newer than saved contents. noWrite(4)........do not save image to local storage at next boot, even if image is newer or different.')
s5AgInfoImgSaveStatus = MibScalar((1, 3, 6, 1, 4, 1, 45, 1, 6, 4, 2, 1, 9), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4))).clone(namedValues=NamedValues(("notAvail", 1), ("noSave", 2), ("saved", 3), ("saveFailed", 4)))).setMaxAccess("readonly")
