if mibBuilder.loadTexts: s5AgInfoFileAction.setStatus('current')
if mibBuilder.loadTexts: s5AgInfoFileAction.setDescription('This object is used to copy a config file or an image file. Typically, the copy is to/from a TFTP server, though other types of sources/destinations are possible. In read operation, if no action taken since the boot up, it will return other(1). Otherwise it will return the latest action such as dnldConfig(2), dnldImg(3), upldConfig(4) and upldImg(5). In write operation, the values that can be written are: dnldConfig(2) ........... download a config file to a device. The new config file will not take effect until the next boot cycle of the device. dnldImg(3) .............. download an image to a device. upldConfig(4) ........... upload a config file to a server from a device. The config file contains the current MIB object values of the device. upldImg(5) .............. upload a image from a device to a server dnldFw(6) ............... download firmware to a device upldFw(7) ............... upload firware from a device to a server dnldImgIfNewer(8) ....... download an image to a device if the image version is newer than the image stored in local NV storage dnldImgToDram(9) ........ download an image to a device, but do not save it to NVRAM, just keep it in DRAM dnldImgNoReset(10) ...... download an image to a device, but do not reset the device after the download dnldFwNoReset(11) ....... download firmware to a device, but do not reset the device after the download dnldImgFromUsb(12) ...... download image from USB port upldImgToUsb(13) ........ upload image to USB port dnldFwFromUsb(14) ....... download firmware from USB port upldFwToUsb(15) ......... upload firmware to USB port dnldConfigFromUsb(16) ... download binary config from USB port upldConfigToUsb(17) ..... upload binary config to USB port dnldLicense(18) ......... download license file from TFTP server upldLicense(19) ......... upload license file to TFTP server dnldLicenseFromUsb(20) .. download license file from USB port upldLicenseToUsb(21) .... upload license file to USB port copyConfigToNvram(22) ... copy the current running configuration into NVRAM dnldSshDsaAuthKeyFromUsb(23) .. download SSH DSA authentication key from USB port dnldImgFromSftp(24) ..... download image from SFTP server dnldFwFromSftp(25) ...... download firmware from SFTP server dnldConfigFromSftp(26) .. download a binary config file from SFTP server upldConfigToSftp(27) .... upload a binary config file to SFTP server dnldSshRsaAuthKeyFromUsb(28) .. download SSH RSA authentication key from USB port dnldSshDsaAuthKeyFromSftp(29) .. download SSH DSA authentication key from SFTP server dnldSshRsaAuthKeyFromSftp(30).. download SSH RSA authentication key from SFTP server dnldImgFromSftpNoReset(31) .. download image from SFTP server, but do not reset the device after the download dnldFwFromSftpNoReset(32) .. download firmware from SFTP server, but do not reset the device after the download dnldLicenseFromSftp(33) .. download license file from SFTP server dnldImgFromUsbNoReset(34).. download image from USB, but do not reset the device after the download. dnldImgIfNewerNoReset(35) ..download an image to a device if the image is newer than the image stored in the local NV storage, but do not reset the device after download dnldImgIfNewerFromUsb(36) ..download an image from usb port to a device if the image is newer than the image stored in the local NV storage dnldImgIfNewerFromUsbNoReset(37) ..download an image from usb port to a device if the image is newer than the image stored in the local NV storage, but do not reset the device after download dnldImgIfNewerFromSftp(38) ..download an image from SFTP server if the image is newer than the image stored in the local NV storage dnldImgIfNewerFromSftpNoReset(39) ..download an image from SFTP server if the image is newer than the image stored in the local NV storage, but do not reset the device after download.')
