if mibBuilder.loadTexts: s5AgentScriptParameters.setStatus('current')
if mibBuilder.loadTexts: s5AgentScriptParameters.setDescription("This object is used to specify the agent script parameters, as strings separated by ';' character. If the string for a parameter is left empty (e.g '42;;255.255.0.0;', ';182.168.1.1;'), the parameter is set to its default value or, if it has none, the parameter is ignored. The value provided with s5AgentScriptParameters must contain the exact number of string parameters (default or not), as described below in each instance of a script. When running a script with its default configuration (this means setting s5AgentScriptRun to default(1) value), s5AgentScriptParameters is modified automatically with the default parameters. For ip-office(1) instance of the script table, the parameters list is: Voice VLAN ID; Voice VLAN gateway IP; Voice VLAN gateway mask; Data VLAN ID; Data VLAN Gateway IP; Data VLAN Gateway mask; IP Route to Gateway Modem-Router; IP Office Call-Server IP; IP Office File Server IP. (e.g. '42;192.168.42.254;255.255.255.0;44;192.168.44.254;255.255.255.0;192.168.44.2;192.168.42.1;192.168.42.1;'). For lldp(2) instance of the script table, the parameters list is: Data VLAN ID; Management VLAN flag; Data VLAN gateway IP; Data VLAN gateway mask; Data VLAN Uplink ports; Management IP address; Management IP mask; Default IP Route; Voice VLAN ID; Voice VLAN gateway IP; Voice VLAN gateway mask; LLDP Call Server IP; LLDP File Server IP; The parameter 'Management VLAN flag' describes whether the data vlan becomes the management vlan (1) or not (0). The following parameters are mandatory: Voice VLAN ID, LLDP Call Server IP, LLDP File Server IP. Management VLAN flag and Data VLAN Uplink ports are mandatory when the Data VLAN is selected. Default IP Route must be introduced when the Management VLAN is changed and an IP mask is mandatory when the corresponding IP address parameter is configured. (e.g. 44;1;192.168.44.254;255.255.255.0;1/23,1/24;192.168.1.1;255.255.255.0;192.168.44.2;42;192.168.42.254;255.255.255.0; 192.168.42.1;192.168.42.1;'). For adac(3) instance of the script table, the parameters list is: Data VLAN ID; Management VLAN flag; Data VLAN gateway IP; Data VLAN gateway mask; Management IP address; Management IP mask; Default IP Route; Voice VLAN ID; Voice VLAN gateway IP; Voice VLAN gateway mask; LLDP Call Server IP; LLDP File Server IP; Uplink trunk flag; ADAC Uplink ports; ADAC Call Server ports; ADAC Telephony ports. The parameter 'Management VLAN flag' describes whether the data vlan becomes the management vlan (1) or not (0). The 'Uplink trunk flag' indicates whether the ports in the 'ADAC Uplink ports' parameter become members of a MLT trunk (1) or not (0). The following parameters are mandatory: Voice VLAN ID, LLDP Call Server IP, LLDP File Server IP, Uplink trunk flag, ADAC Uplink ports, ADAC Call Server ports, ADAC Telephony ports. Management VLAN flag is mandatory when the Data VLAN is selected. Default IP Route must be introduced when the Management VLAN is changed and an IP mask is mandatory when the corresponding IP address parameter is configured. (e.g.'44;1;192.168.44.254;255.255.255.0;192.168.1.1;255.255.255.0;192.168.44.2;42;192.168.42.254;255.255.255.0; 192.168.42.1;192.168.42.1;1;1/23-24;1/1;1/2-22;') The voice(4) instance of the script table is unsupported.")
